import React, { useEffect, useState } from "react";
import RoomItem from "./RoomItem";
import {
  Container,
  Paper,
  Grid,
  Button,
  Stack,
  ClickAwayListener,
  Tooltip,
  TextField,
} from "@mui/material";
import styled from "styled-components";
import { useSelector } from "react-redux";

import SearchIcon from "@mui/icons-material/Search";
import KeyboardArrowLeftIcon from "@mui/icons-material/KeyboardArrowLeft";
import KeyboardArrowRightIcon from "@mui/icons-material/KeyboardArrowRight";

import axios from "axios";

function RoomList() {
  const me = useSelector(state => state.user);
  const roomList = useSelector(state => state.roomList);
  const [page, setPage] = React.useState(1);
  const beforePage = () => {
    setPage(page - 1);
  };
  const afterPage = () => {
    setPage(page + 1);
  };
  useEffect(()=>{

  },[])
  // 방검색
  const [searchResult, setSearchResult] = useState([]);
  const [searchYes,setSearchYes] = useState(false)
  // 방 검색 실패 모달
  const [doNot, setDoNot] = useState(false);
  const DoNotOpen = () => setDoNot(true);
  const DoNotClose = () => setDoNot(false);
  const [searchTitle, setSearchTitle] = useState("");
  const searchRoom = () => {
    axios
      .post(
        "/api/room/list",
        {
          capacity: 6,
          mafiaNum: 1,
          title: searchTitle,
        },
        {
          headers: {
            "Content-Type": "application/json",
            Authorization: `Bearer ${me.accessToken}`,
          },
        }
      )
      .then(res => {
        setSearchTitle("");
        console.log(res.data)
        if (res.data.length) {
          setSearchYes(true)
          setSearchResult(res.data);
        } else {
          DoNotOpen();
        }
      })
      .catch(err => {
        console.log("실패", err);
      });
  };

  return (
    <Paper sx={{ width: "100%", height: "250px" }}>
      <Stack direction='row'>
        <ClickAwayListener onClickAway={DoNotClose}>
          <Tooltip
            PopperProps={{
              disablePortal: true,
            }}
            onClose={DoNotClose}
            open={doNot}
            disableFocusListener
            disableHoverListener
            disableTouchListener
            title='검색된 방이 없습니다.'
          >
            <TextField
              fullWidth
              id='outlined-textarea'
              placeholder='Search'
              size='small'
              value={searchTitle}
              onChange={e => {
                setSearchTitle(e.target.value);
              }}
            />
          </Tooltip>
        </ClickAwayListener>
        {searchYes ? (
          <Button
            variant='outlined'
            onClick={() => {
              setSearchResult([]);
              setSearchYes(false)
            }}
          >
            X
          </Button>
        ) : (
          <Button variant='outlined' onClick={searchRoom}>
            <SearchIcon />
          </Button>
        )}
      </Stack>
      <Border sx={{ height: 500 }}>
        {searchYes ? (
          // {/* 검색 결과 방목록 */}
          <Container maxWidth='lg'>
            <Grid container spacing={2}>
              {searchResult &&
                Array.from(searchResult).slice((page - 1) * 8, page * 8).map((room, index) => (
                  <Grid item xs={6} key = {index}>
                    <RoomItem room={room} />
                  </Grid>
                ))}
            </Grid>
            {page === 1 ? (
              <Button onClick={beforePage} disabled>
                <KeyboardArrowLeftIcon />
              </Button>
            ) : (
              <Button onClick={beforePage}>
                <KeyboardArrowLeftIcon />
              </Button>
            )}
            {page < parseInt(roomList.length / 8 + 1) ? (
              <Button onClick={afterPage}>
                <KeyboardArrowRightIcon />
              </Button>
            ) : (
              <Button onClick={afterPage} disabled>
                <KeyboardArrowRightIcon />
              </Button>
            )}
          </Container>
        ) : (
          // {/* 전체 방목록 */}
          <Container maxWidth='lg'>
            <Grid container spacing={2}>
              {roomList &&
                Array.from(roomList).slice((page - 1) * 8, page * 8).map((room, index) => (
                  <Grid item xs={6} key = {index}>
                    <RoomItem room={room} />
                  </Grid>
                ))}
            </Grid>
            {page === 1 ? (
              <Button onClick={beforePage} disabled>
                <KeyboardArrowLeftIcon />
              </Button>
            ) : (
              <Button onClick={beforePage}>
                <KeyboardArrowLeftIcon />
              </Button>
            )}
            {page < parseInt(roomList.length / 8 + 1) ? (
              <Button onClick={afterPage}>
                <KeyboardArrowRightIcon />
              </Button>
            ) : (
              <Button onClick={afterPage} disabled>
                <KeyboardArrowRightIcon />
              </Button>
            )}
          </Container>
        )}
      </Border>
    </Paper>
  );
}
const Border = styled.section`
  border: 1px solid rgba(0, 0, 0, 0.2);
  border-radius: 5px;
  margin: 0.5em;
`;
export default RoomList;
